import {useState} from "react";
const SimpleGreet = ()=>{
	const [greeter,setGreeter] = useState("");
	const handler = ()=>{
		fetch("http://localhost:8080/getter")
		.then(data=>data.json())
		.then(json=>setGreeter(json.data));
	}
	return(
		<div className="simple-greet">
			<button onClick={handler}>click me</button>
			<p>The value is : {greeter}</p>
		</div>
	)
}

export default SimpleGreet;
